INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (0, 31, '2025-03-17 08:43:10', '2025-03-17 08:43:10', 6, 145, 'trainer10@example.com', '자격사항\n- 생활 스포츠 지도사 2급\n- 노인 스포츠 지도사\n- 유소년 스포츠 지도사\n- 텍티컬펑셔널트레이닝협회 케틀벨어드벤스트레이닝 수료\n- 텍티컬펑셔널트레이닝협회 쌩기초해부학 수료\n-  텍티컬펑셔널트레이닝협회 펑셔널 보디빌딩\n (상지파트, 하지파트) 수료\n​\n​\n백민재트레이너는\n10년 경력답게\n다양한 회원님들의 케이스를 접하고\n회원님들의 니즈를 100% 충족 시켜주는\n유일무이한 트레이너 입니다.', '윤지혜', 's_e613781e-8fc1-421b-a31e-d85e6be667a2-907f696f24d730fbf065041285fcad7a.jpg');
INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (1, 26, '2025-03-17 08:43:11', '2025-03-17 08:43:11', 6, 146, 'trainer11@example.com', '1. 10년 경력, 무수히 많은 케이스 수업\n폭 넓은 연령 대의 회원님들 수업이 가능합니다\n​\n2. 회원님들을 위해 꾸준히 공부\n회원님들의 운동을 재미있고 의미있게 만들어 드립니다\n​\n3. 친절, 꼼꼼의 대명사\n운동을 처음 시작하시는 분들께 인기 만점\n운동이 처음이라도 걱정마세요\n​\n4. 함께 되찾는 일상\n생활을 하시다가 다치셨다면?\n다시 생활을 잘 하실 수 있게끔 도와드립니다', '조현우', 's_d164b5b8-e6b5-480e-a714-115047af1be2-8dfe7a441d1f35539c619d2aa33bd954.jpg');
INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (1, 33, '2025-03-17 08:43:11', '2025-03-17 08:43:11', 101, 147, 'trainer12@example.com', '트레이너가 된 이유는 각자 다양하지만, 저는 몸이 아팠던 경험,\n그리고 그 경험에 이어 자신의 몸을 생각해주고 통증을 개선해줬던 아주 귀한 선생님을 만났습니다.\n​\n그런 이유에서 트레이너라는 직업에 들어섰고, 많은 공부와 자격증을 거쳐 \n회원님들께도 그런 선생님이 되고 싶습니다.', '한소연', 's_2a48deaf-148d-4082-aae1-60700d4e1aef-8b889906d836cdce6a0c2966c8987402.jpg');
INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (1, 31, '2025-03-17 08:43:11', '2025-03-17 08:43:11', 102, 148, 'trainer13@example.com', 'WNGP 피지크 주니어 4th\nK-Classic 인천 클래식피지크 3rd\nK-Classic 인천 보디빌딩 TOP6\n다이어트 프로그래머 수료\n교정운동학 수료\n피티인폼 불균형재활 전문가 수료', '남기준', 's_8246c442-7f43-4618-941a-7cdf2564f9c9-9a70ec0e69b648f1fc648a827c834792.jpg');
INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (1, 22, '2025-03-17 08:43:12', '2025-03-17 08:43:12', 103, 149, 'trainer14@example.com', '1. 10년 경력, 무수히 많은 케이스 수업\n폭 넓은 연령 대의 회원님들 수업이 가능합니다\n​\n2. 회원님들을 위해 꾸준히 공부\n회원님들의 운동을 재미있고 의미있게 만들어 드립니다\n​\n3. 친절, 꼼꼼의 대명사\n운동을 처음 시작하시는 분들께 인기 만점\n운동이 처음이라도 걱정마세요\n​\n4. 함께 되찾는 일상\n생활을 하시다가 다치셨다면?\n다시 생활을 잘 하실 수 있게끔 도와드립니다', '오세라', 's_ea7debe5-9ace-4d67-8649-5ab8a174f164-0ac65600dffde26de5e0a883a5e8ba0d.jpg');
INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (1, 31, '2025-03-17 08:43:12', '2025-03-17 08:43:12', 104, 150, 'trainer15@example.com', '( 현 ) 바디플렉스짐 송정역점 트레이너\n( 전 ) 팀윤짐 트레이너\n( 전 ) 팀윤짐 청라점 지점장\n​\n생활스포츠지도사 2급 보디빌딩\nNASM(미국 국가공인 스포츠의학 교육단체) CES 교정운동전문가\n안녕하세요. 서우민 트레이너입니다.\n운동은 선택이 아니라 필수라고 생각합니다.\n​\n하지만 소비자분들께서는 운동을 배우는 시설, \n트레이너를 선택하는게 어려우실 거 같아요.\n​\n저는 신뢰를 가장 중요하게 생각합니다.\n​\n회원님과의 관계를 중요시하고 \n회원님의 몸이 건강한 방향으로 가도록 돕겠습니다. \n​\n부담없이 배우러 와주세요. 쉽게 알려드리겠습니다.', '손대현', 's_054ec07c-5b97-4d73-8e26-5c68b4f52796-e739bb516157da51c0240b45cb4ceda2.jpg');
INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (0, 31, '2025-03-17 08:43:12', '2025-03-17 08:43:12', 105, 151, 'trainer16@example.com', '운동이 처음이라 걱정된다?\" \"체형 교정이 필요하다?\"\n걱정 마세요! 각 분야의 전문가 트레이너와 함께라면 목표 달성이 더욱 쉬워집니다. ? 1. 정원봉 트레이너 (센터 총괄 담당 매니저)\n✔ 전문 분야: 근육 증량, 퍼스널 트레이닝, 바디 메이킹\n✔ 경력: 피지크 모델 대회 다수 수상 / NASM 국제 PT 자격 보유\n✔ 특징: 올바른 운동 자세 & 효율적인 루틴 설계\n? \"근육을 키우고 싶다면? 저와 함께 기초부터 탄탄하게!\"\n트레이너 선생님을 소개합니다 ?️‍♀️|작성자 업타운휘트니스왕십리', '백지영', 's_3275a2f5-c18a-4928-b559-ffaaecdd92e7-1dbc9af521822fbd35a5acedffa687af.jpg');
INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (0, 32, '2025-03-17 08:43:13', '2025-03-17 08:43:13', 106, 152, 'trainer17@example.com', '다이어트, 체형교정, 건강관리 등\n운동을 시작하는 이유는 다양합니다.\n​\n하지만 \n운동을 시작하기 전, \n가장 걱정되는 부분 중 하나는 \n\'트레이너와 나의 호흡이 맞을까?\n\'하는 점일 겁니다.\n누구나\n\'나와 잘 맞는 선생님\'과\n함께 운동하고 싶으실 테니까요.\n​\n사람마다  \'잘 맞는다\'는 기준은 다르겠지만\n저는 소통, 전문성, 건강한 마음가짐이 \n가장 중요하다고 생각합니다.\n​\n시키고 수행하는 운동만 하는 것만이 아닌\n함께 공감하는 트레이너로서 \n회원님들과 같이 맞춰나가겠습니다.', '유승민', 's_a19841b2-93d8-4995-b2be-6c2ca2ec48ea-2a1063078bf915f60f1776e313e81169.jpg');
INSERT INTO trainer_form (gender, age, closed_at, created_at, gym_id, id, email, introduction, name, profile_image) VALUES (0, 34, '2025-03-17 08:43:13', '2025-03-17 08:43:13', 8, 153, 'trainer18@example.com', '트레이너 17년 차 1만 명 이상의 \n트레이닝 경험을 토대로 \n체계적인 수업을 제공해 드립니다!\n​\n보행 평가, 체형분석, 도수근력\n평가를 통해 안전하고 명확한 \n트레이닝 방향성을 제공합니다.\n어려운 운동 가장 빠른 길로 확실한 변화 시켜드립니다\n​\n괜히 지점장이 아니시겠죠?!\n귀중한 시간과 돈 헛되지 않게\n확실하게 배워가시길 바랍니다 ❤️‍?', '노하은', 's_c2cbd584-6304-48f3-9a05-2d1efc4534a1-d6d84bab42056f3101966b4dca575f76.jpg');
